text:
f • i • v • e days until #womenwednesday 
@closethegapca @equalrightsadv and @howwomenlead are gearing up for #womenwednesday - a day to raise awareness, generate resources and inspire activism focused on supporting and inspiring women's leadership in both private and public sectors in california. 
as we celebrate our inaugural year, join us wednesday, november 28, by getting involved or donating to one of the founding #womenwednesday partners (including california women lead!), or a partner of your choice that shares our vision for women in california. help us channel the outrage of #metoo and #timesup into positive lasting change. send us a message or email us at admin@cawomenlead.org if your organization is interested in partnering with us on #womenwednesday

