text:
visitors at celebrate bandra - talkietive literature sessions were in for a delightful evening as romance novelist sudeep nagarkar and literary fiction author meghna pant had a light-hearted yet thought-provoking conversation. both the award-winning writers discussed why indians are the most romantic people in the world, how movies have influenced the idea of love in our culture and the impact of #metoo movement in bollywood.

